function sortUp(items, sortBy) {
  switch (sortBy) {
    case 'price-ascending':
      return items.sort((a,b) => {return a.price-b.price});
    case 'price-descending':
      return items.sort((a,b) => {return a.price-b.price});
    default:
      return items;
  }
}

export default sortUp;
